import { BrowserRouter, Routes } from "react-router-dom";
import HomePage from "./pages/HomePage";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/home" element={<HomePage></HomePage>}/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
